`define H_ACTIVE        11'd1024
`define H_BACK_PORCH    11'd160
`define H_TOTAL         11'd1344
        
`define V_SYNC_PULSE    11'd6
`define V_FRONT_PORCH   11'd3
`define V_ACTIVE        11'd768
`define V_BACK_PORCH    11'd29
