module vga (
        input           clk,
        input           rstn,
        input [31:0]    data,
        input    change1,
        input    change2,
        output          hs,
        output          vs,
        output [3:0]    r,
        output [3:0]    g,
        output [3:0]    b
    );

    wire clk_vga;
    
    clk_wiz_ip u_clk_wiz (
        .clk_in1(clk),
        .reset(~rstn),
        .clk_out1(clk_vga)
    );
    
    reg [10:0]  h_cur;
    reg [10:0]  v_cur;
    
    integer mode;
    
    reg [31:0]count;
    reg [3:0] scount;
    integer s;
    
    reg [1:0]modenum;
    
    always @ (posedge clk_vga) begin // button press
        modenum<={change1,change2};
        case(modenum)
            2'b00: begin
                    mode=0;
                   end
            2'b01: begin
                    mode=1;
                   end
            2'b10: begin
                    mode=2;
                   end
            2'b11: begin
                    mode=3;
                   end
        endcase
    end
    
    always @ (posedge clk_vga) begin
        if (!rstn) begin
            h_cur <= 11'b0;
            v_cur <= 11'b0;
        end
        else begin
            if (h_cur == `H_TOTAL - 1) begin
                h_cur <= 11'b0;
                if (v_cur == `V_TOTAL - 1) begin
                    v_cur <= 11'b0;
                end
                else begin
                    v_cur <= v_cur + 1;
                end
            end
            else begin
                h_cur <= h_cur + 1;
                v_cur <= v_cur;
            end
        end
    end
        
        
    reg reg_hs;
    reg reg_vs;
    
    always @ (posedge clk_vga) begin
        if (h_cur < `H_SYNC_PULSE) begin
            reg_hs <= 1'b0;
        end
        else begin
            reg_hs <= 1'b1;
        end  
    end  
    
    always @ (posedge clk_vga) begin
        if (v_cur < `V_SYNC_PULSE) begin
            reg_vs <= 1'b0;
        end
        else begin
            reg_vs <= 1'b1;
        end  
    end
          
    assign hs = reg_hs;
    assign vs = reg_vs;
    
    
